export function getUserById(userId) {
  return users.find((e) => {
    if (e.id === userId) {
      return e.id;
    } else {
      return null;
    }
  });
}
export function updateUser(user) {
  const originalUser = users.find((e) => {
    return e.id === user.id;
  });
  if (originalUser) {
    const index = users.indexOf(originalUser);
    users.splice(index, 1, user);
    return user;
  } else {
    return null;
  }
}

export default users;
